=head1 DESCRIPTION

Provides details about a predictor event, such as a retraining.

=head1 ATTRIBUTES


=head2 Datetime => Str

The timestamp for when the event occurred.


=head2 Detail => Str

The type of event. For example, C<Retrain>. A retraining event denotes
the timepoint when a predictor was retrained. Any monitor results from
before the C<Datetime> are from the previous predictor. Any new metrics
are for the newly retrained predictor.



